import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navigation from './Navigation';
import Home from './Home';
import About from './About'; // Add the import statement for the About page
import Products from './Products'; // Add the import statement for Products
import Contact from './Contact'; // Add the import statement for Contact

function App() {
  return (
    <Router>
      <div>
        <Navigation />

        <Routes>
          <Route path="/" element={<About />} /> {/* About page as the default page */}
          <Route path="/home" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/products" element={<Products />} />
          <Route path="/contact" element={<Contact />} />
          {/* Add more routes for other sections/pages */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
